import React from 'react';


const SongArtist = ({data}) => {


    return ( 
        <div>
            <h2>{data.name && data.name}</h2>
            {data.images && <img src={data.images[0].url} alt="img"/>}
            <br/><br/><br/>

            <div>
                <div>
            {data.genres && data.genres.map((el, index)=> <span key={index}>{el.toUpperCase()}</span>)}
                </div>
            <br/>
            {data.followers && <p>{data.followers.total} Followers</p>}
            </div>

            <br/>
            {data.external_urls && <a href={data.external_urls.spotify} target="_blank" rel="noopener noreferrer">Spotify</a>}

        </div>
     );
    }

    export default SongArtist;



